    "2016-02-12T13:45:57.211054",nt"name": "spot-controlled-image-base-10-meter",nt"isopen":
    false,nt"url": null,nt"notes": "SPOT Controlled Image Base 10 meter (CIB-10)
    is a collection of orthorectified panchromatic (grayscale) images. The data were
    acquired between 1986 and 1993 by the French space agency, Centre National d'Etudes
    Spatiales (CNES), which owns and operates the SPOT satellite system. The panchromatic
    images were orthorectified using NGA Digital Terrain Elevation Data Level 1 to remove
    image distortion and obtain the geometric qualities of a map. The satellite image
    mosaic products cover large areas of the United States, Europe, Middle East, Southeast
    Asia, North and South Korea, Central America, western Russia, and other smaller
    areas around the globe. The coverage map in EarthExplorer shows the extent of available
    data.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
